var tipuesearch = {"pages":[{"title":"About","text":"協同產品設計實習 課程倉儲: https://github.com/40923207/cd2022 內容管理: https://40923207.github.io/cd2022/content/index.html 課程投影片: https://40923207.github.io/cd2022/reveal/index.htmll 課程網誌: https://40923207.github.io/cd2022/blog/index.htmlg","tags":"misc","url":"./pages/about/"},{"title":"midterm","text":"","tags":"Misc","url":"./online.html"},{"title":"midterm","text":"2022 Spring 協同產品設計實習. 倉儲連結 軟體分配 40823215:NX2008 40923203:Onshape 40923204:Onshape 40923207:NX12 40923209:NX1980 40923213:Solvespace 40923220:NX12 40923240:NX1980 零組件繪製過程與 CoppeliaSim 操控流程及心得: 零組件繪製過程 使用NX12進行零件繪製及工程圖繪製 CoppeliaSim 操控流程 1.將繪製好並組合好的檔案轉成STL檔 2.開啟Coppeliasim匯入剛轉好的STL檔 3.將模型移到適當位置 4.分解模型 5.將多餘的零件關閉所有圖層的顯示(螺釘、螺帽...) 6.把所有模型簡化 7.加上程式碼 8.裝上馬達並將馬達取對應程式碼的名字 9.開始連接模型以及馬達 10.模擬作動 心得: 經過這次W8的作業後 1.我了解到Coppeliasim各版本的差異，像是語法的不同、功能的不同、舊版不能開新版檔案等差異 2.Coppeliasim的檔名不要使用中文、檔案放置位置的資料夾也盡量都使用英文，不然在模擬時容易出現找不到檔案的問題","tags":"Misc","url":"./midterm.html"},{"title":"w7","text":"2022 Spring 協同產品設計實習. 倉儲連結 軟體分配 40823215:NX2008 40923203:Onshape 40923204:Onshape 40923207:NX12 40923209:NX1980 40923213:Solvespace 40923220:NX12 40923240:NX1980","tags":"Misc","url":"./w7_summary.html"},{"title":"2022 Spring CD 課程","text":"2022 Spring 協同產品設計實習. 雲端空間 原本 Google Drive 教育版可以存放不限空間的政策, 2022.07 即將失效, 屆時每一個帳號下只能至多儲存 3GB 的資料. 取而代之的是 MicroSoft 提供的教育版 OneDrive, 每一名使用者可以存放至多 5TB 容量的檔案. 協同主題 2022cd 課程的主題為 uArm, 我們希望各分組組員採用 Solvespace、NX 以及 Onshape 設計繪製能夠用於 Tic-Tat-Toe 遊戲的機械手臂. 從 uArm 中的影片與下載檔案、uArm Developer Guide、uArm test kit 與 uFactory uArm 可以取得與 uArm 機械手臂相關的技術資料.","tags":"Misc","url":"./w6_40923207.html"}]};